import React, { useState, useEffect } from "react";
import axios from "axios"; // Import axios
import Action1 from "../../../assets/icons/Action1.svg";
import Action2 from "../../../assets/icons/Action2.svg";
import Action3 from "../../../assets/icons/Action3.svg";
import AppointMentDetailModal from "./Modal/AppointMentDetailModal";

const AppointmentTable = () => {
  const [appointments, setAppointments] = useState([]); // State to hold the fetched data
  const [loading, setLoading] = useState(true); // Loading state
  const [showModal, setShowModal] = useState(false);

  const openModal = () => setShowModal(true);
  const closeModal = () => setShowModal(false);

  // Fetch appointment data from the API
  useEffect(() => {
    const fetchAppointments = async () => {
      try {
        const response = await axios.get(
          "http://localhost:8080/appointment/all-appointments"
        );
        setAppointments(response.data);
        console.log("response.data", response.data.object);
        setLoading(false);
      } catch (error) {
        console.error("Error fetching appointments:", error);
        setLoading(false);
      }
    };

    fetchAppointments();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <div className="overflow-x-auto mx-5 my-5 ">
      <table className="min-w-full bg-white border border-gray-300">
        <thead>
          <tr className="bg-gray-100">
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              #
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Name
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Age
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Email
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Gender
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Department
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Date
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Time
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Doctor
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Fees
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 "></th>
          </tr>
        </thead>
        <tbody>
          {appointments.map((appointment, index) => (
            <tr key={appointment.id}>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {index + 1}
              </td>
              <td className="flex flex-row items-center py-4 border-b text-sm text-gray-700 text-center">
                <img
                  src={
                    appointment.patientImage || "https://via.placeholder.com/50"
                  }
                  alt="img"
                  className="w-12 h-12 rounded-full mr-4"
                />
                {appointment.name}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.age}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.email}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.gender}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.department}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.date}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.time}
              </td>
              <td className="flex flex-row py-4 border-b items-center text-sm text-gray-700 text-center">
                <img
                  src={
                    appointment.doctorImage || "https://via.placeholder.com/50"
                  }
                  alt="Doctor"
                  className="w-12 h-12 rounded-full mr-4"
                />
                {appointment.doctor}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.fees}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                <div className="flex flex-row">
                  <img
                    src={Action1}
                    alt="Action"
                    onClick={openModal}
                    className="cursor-pointer"
                  />
                </div>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <AppointMentDetailModal show={showModal} onClose={closeModal} />
    </div>
  );
};

export default AppointmentTable;
